import styled from "styled-components";


export const StyledHeader = styled.header`
    background: #000;
    height: 80px;
    margin-top: -80px;
    display: flex;
    justify-content: center;
    align-items: center;
    front-size: 1rem;
    position: sticky;
    top:0
    z-index: 10;

`
